	this.shape_1.graphics.f("#A53792").s().p("");
	this.shape_1.setTransform(59.7701,40.2997,0.3712,0.3712);

	this.shape_2 = new cjs.Shape();
	this.shape_2.graphics.f("#A53792").s().p("");
